.t-swipe {
  width: 100%;
  margin: 0 auto;
  background-color: #F5F5f5;
}
.t-swipe-item {
  height: 65px;
  line-height: 65px;
  font-size: 16px;
  color: #333333;
}
.t-swipe-item-title {
  width: 100%;
  height: 45px;
  line-height: 50px;
  font-size: 14px;
  color: #999999;
  text-indent: 1em;
}
.t-swipe-item-con {
  background-color: #FFFFFF;
  text-indent: 1em;
  position: relative;
  height: 100%;
  color: #333333;
}
.t-swipe-item-con::after {
  content: "";
