    this.setData({
      [`visible${index}`]: false
    })
  },

  handleAction(item, index, e) {
    if (item.key === 'delete') {
      my.confirm({
        content: '你确定要删除吗?'
      })
      return;
    }
    my.alert({
      content: `你点击了${item.key}`
    })
  }
})

