import { Form } from 'antd-mini/es/Form/form';


Page({
  form: new Form({
    rules: {
      imageList: [
        {
          required: true,
          message: '需要上传图片'
        },
        (form) => ({
          async validator(_, fileList = []) {
            if (fileList.length !== 3) {
